import React from "react";
import { useState } from "react";



const Expense = () => {
    const [showForm, setShowForm] = useState(false);




    return(
        <div>
            <div>
                Expense Tracker
            </div>

            <div>
            <a href="/"  onClick={() => {
            setShowForm(!showForm);
            
            }}>
            {showForm ? 'Cancel' : 'Add New Expense'}
            </a>
            </div>

           
        </div>

    )
}


export default Expense;
